    const dispatch = useDispatch();

    const getExperiments = () => {
        dispatch(getExperiments())
    }

    return (
      <div>
        <h1>Screen A</h1>  
        <input type="button" onClick={getExperiments} value="Submit"/>
        {
            isShowLoader && (
                <Loader />
            )
        }
      </div>
  )
}
